import React from 'react';

type imageProp = {
    tracker: trackerType
    image: any
}

export type trackerType = {
    x?: number
    y?: number
}

const Image: React.FC<imageProp> = (props) => {
    const {tracker} = props;
    return <><img src="/src/images/cat.png" style={{position: 'absolute', left: tracker.x, top: tracker.y}}/></>
};

export default Image;
